            </View>
        );
    }
}

const styles = StyleSheet.create({
    top_container: {
        paddingTop: Constants.statusBarHeight,
        backgroundColor: 'red',
    },
    flexrow_container: {
        flexDirection: 'row',
        backgroundColor: 'blue',
        justifyContent: 'center',
    },
    cell: {
        backgroundColor: "#ebedf0",
        height: 20,
        width: 20,
        margin: 5,
    }
});
